CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_waktu_tayang` (IN `p_id_waktutayang` VARCHAR(4), IN `p_id_film` VARCHAR(4), IN `p_waktu_mulai` TIMESTAMP)   BEGIN
    DECLARE v_durasi INT;
    DECLARE v_waktu_selesai TIMESTAMP;

    -- Mendapatkan durasi film berdasarkan ID film
    SELECT DURASI INTO v_durasi FROM film WHERE ID_FILM = p_id_film;

    -- Menambahkan durasi film ke waktu_mulai untuk mendapatkan waktu_selesai
    SET v_waktu_selesai = DATE_ADD(p_waktu_mulai, INTERVAL v_durasi MINUTE);

    -- Insert data ke tabel waktu_tayang
    INSERT INTO waktu_tayang (ID_WAKTUTAYANG, ID_FILM, WAKTU_MULAI, WAKTU_SELESAI)
    VALUES (p_id_waktutayang, p_id_film, p_waktu_mulai, v_waktu_selesai);
    
    SELECT 'Data berhasil ditambahkan' AS status;
END$$

DELIMITER ;

